#include <iostream>
#include <vector>
#include <limits>
using namespace std;

class Solution {
public:
    string minWindow(string s, string t) {
        vector<int> v (128, 0);
        for (auto c: t)
            v[c]++;
        size_t count = t.size(), begin = 0, end = 0, head = 0, d = numeric_limits<int>::max();
        while (end < s.size()) {
            if (v[s[end++]]-- > 0)
                count--;
            while (count == 0) {
                if (end - begin < d) {
                    d = end - begin;
                    head = begin;
                }
                if (v[s[begin++]]++ == 0)
                    count++;
            }
        }
        return d == numeric_limits<int>::max() ? "" : s.substr(head, d);
    }
};

int main(int arg, char *argv[]) {
    // insert code here...
    cout << "LeetCode 076 Minimum Window Substring, C++ ...\n\n";
    Solution sol;
    string s = "ADOBECODEBANC";
    string t = "ABC";
    //s = "a";
    //t = "aa";
    //s = "";
    //t = "";
    
    string r = sol.minWindow(s, t);
    cout << r << '\n';
    
    return 0;
}